userDefinedLinkHintCss:
div.internalVimiumHintMarker {
  background: linear-gradient(to bottom, #434c5e 0%, #2e3440 100%);
  border: none;
  padding: 2px 4px 1px 4px;
  border-radius: 0.25em;
  box-shadow: 0em 0.1em 0.6em 0.1em #2e3440;
}

div.internalVimiumHintMarker span {
  color: #d8dee9;
  font-size: inherit;
  font-family: JetBrainsMono Nerd Font;
  text-shadow: #2e3440;
}

div.internalVimiumHintMarker > .matchingCharacter {
  color: #4c566a;
}

#vomnibar {
  border: 1px solid #2e3440;
  box-shadow: 0px 2px 10px #2e3440;
  background-color: #3b4252;
}
#vomnibar .vomnibarSearchArea {
  background-color: #3b4252;
  border: none;
}

#vomnibar input {
  color: #d8dee9;
  background-color: #3b4252;
  border: 1px solid #3b4252;
  box-shadow: none;
  font-family: JetBrainsMono Nerd Font;
}

#vomnibarInput::selection {
  color: #2e3440;
  background-color: #d8dee9;
}

#vomnibar ul {
  margin: 0;
  background-color: #2e3440;
}


#vomnibar ul li {
  border-bottom: 1px solid #434c5e;
}

#vomnibar ul li.vomnibarSelected {
  border-bottom: 1px solid #434c5e;
}

#vomnibar ul li.vomnibarSelected {
  background-color: #3b4252;
}

#vomnibar ul li .vomnibarSource {
  color: #b48ead;
}

#vomnibar ul li .vomnibarTitle {
  color: #d8dee9;
}
#vomnibar ul li .vomnibarTitle .vomnibarMatch,
#vomnibar ul li .vomnibarUrl .vomnibarMatch {
  color: #ebcb8b;
  font-weight: normal;
}

#vomnibar ul li .vomnibarUrl {
  color: #5e81ac;
}

#vomnibar li .vomnibarTopHalf {
  overflow: visible;
}
